import chat from '../../static/chat.svg';
import profile from '../../static/profile.jpg';
import plus from '../../static/plus.svg';
import search from '../../static/search.svg';

function Btmbar() {
  return (
    <div className="bg-pink-50 flex flex-wrap flex-col justify-around shadow-xl fixed h-full" style={{width: "10%", top: 0, right:0}}>
        <div>
            <img className="mx-auto w-48 rounded-3xl shadow-md border-2 border-red-100" src={profile}/>
        </div>
        <div>
            <img className="mx-auto w-64" src={chat}/>
        </div>
        <div className="flex justify-evenly">
            <div className="mx-auto object-scale-down">
                <img src={plus}/>
            </div>
            <div className="mx-auto object-scale-down">
                <img src={search}/>
            </div>
        </div>
    </div>
  );
}

export default Btmbar;
